import React from 'react';
import './header.css';

const Jumbo = () => (
    <div class="jumbotron jumbotron-fluid text-center">
    <div class="container">
      <h1 class="display-4">Clicky Game</h1>
     <p class="lead text-center">Click on an image to earn points, you loose if you click the same image more than once.</p>
    </div>
  </div>
);
export default Jumbo;
